                var callback = function (row) {
                    var icon = L.AwesomeMarkers.icon();
                    var marker = L.marker(new L.LatLng(row[0], row[1]));
                    marker.setIcon(icon);
                    return marker;
                };

                var data = [];
                var cluster = L.markerClusterGroup({"disableClusteringAtZoom": 15});

                for (var i = 0; i < data.length; i++) {
                    var row = data[i];
                    var marker = callback(row);
                    marker.addTo(cluster);
                }

                cluster.addTo(map_28840b3dd3512f3fcafeae069a08e570);
                return cluster;

            var fast_marker_cluster_f4c44a5be0dbe4af59fc0bc100dcdf1b = (function(){
                
                var callback = function (row) {
                    var icon = L.AwesomeMarkers.icon();
                    var marker = L.marker(new L.LatLng(row[0], row[1]));
                    marker.setIcon(icon);
                    return marker;
                };

                var data = [];
                var cluster = L.markerClusterGroup({"disableClusteringAtZoom": 12});

                for (var i = 0; i < data.length; i++) {
                    var row = data[i];
                    var marker = callback(row);
                    marker.addTo(cluster);
                }

                cluster.addTo(map_28840b3dd3512f3fcafeae069a08e570);
                return cluster;
            })();
